import "./navbar.css"
import React from 'react';


export default function Navbar() {


  const onChangeFunction = (event) => {


    console.log(event.target.value)
    /* signal to React not to nullify the event object */
    event.persist();

    if (!this.debouncedFn) {
      const debouncedFn = setTimeout(function(){

        let searchString = event.target.value;
      },300)


      (() => {

        //fetchSearchData(searchString);
      }, 300);
    }
    this.debouncedFn();
  }

  return (
    <div class="form-group has-success has-feedback">
      <label class="col-sm-2 control-label" for="inputSuccess">Search</label>
      <div class="col-sm-10">
        <input type="text" class="form-control" id="inputSuccess" onChange={onChangeFunction} />
        <span class="glyphicon glyphicon-ok form-control-feedback"></span>
      </div>
    </div>
  )

}
